import React from 'react';
import './LandingPage.css'; // Assuming you will create a CSS file for specific styles

const LandingPage: React.FC = () => {
    return (
        <div className="landing-page">
            <img src="/resume/Saqib_Profile.jpg" alt="Profile" className="profile-pic" />
            <h1>Sheik Saqib Ahmed</h1>
            <h2>Software Engineer</h2>
            <div className="cta-buttons">
                <a href="/resume/Sheik_Saqib_Ahmed.pdf" className="btn">Download Resume</a>
                <a href="/ContactForm" className="btn">Contact Me</a>
            </div>
        </div>
    );
};

export default LandingPage;
